import React from "react";
import "./Home.scss";
import { Table, Container, Row, Col } from "react-bootstrap";
import { useParams } from "react-router-dom";
import NavBar from "../Main/NavBar/NavBar.jsx";

const Home = (props) => {
  const { name } = useParams();

  return (
    <Container fluid>
      <NavBar />
    </Container>
  );
};

export default Home;
